package sharego

import (
	"testing"
)

func newTestDocument() Document {
	return NewDocument(
		Dict{
			"doc": "Haha this is is some text",
		},
	)
}

func TestDocumentGet(t *testing.T) {
	doc := newTestDocument()
	target := "Haha this is is some text"
	result, err := doc.Get([]string{"doc"})
	if err != nil {
		t.Errorf("Cannot read document:", err)
	}
	if result != target {
		t.Errorf("Cannot read document got %q expected %q", result, target)
	}
}

func TestDocumentSnapshotWithValidOps(t *testing.T) {
	doc := newTestDocument()
	target := "Hahaho this is some text"
	op1 := Operation{Component{
		Path: []string{"doc", "4"},
		Si:   "ho",
	}, Component{
		Path: []string{"doc", "12"},
		Sd:   "is ",
	}}
	err := doc.ApplyToVersion(op1, doc.Version())

	if err != nil {
		t.Errorf("Simple Operation failed (Error %q)", err)
	}
	dict, _ := doc.Snapshot()
	result, _ := dict.get([]string{"doc"})
	if result != target {
		t.Errorf("simple Operation failed %q != %q", result, target)
	}
}

func TestDocumentSnapshotConcurrentLeft(t *testing.T) {
	doc := newTestDocument()
	target := "Hahaho this is some text"
	version := doc.Version()
	op1 := Operation{Component{
		Path: []string{"doc", "4"},
		Si:   "ho",
	}}
	// Expecting Hahaho this is is some text
	op2 := Operation{Component{
		Path: []string{"doc", "7"},
		Sd:   "is ",
	}}
	// Expecting Haha this is some text
	// Combination of both should end up in Hahaho this is some text

	//RIGHT OP
	err := doc.ApplyToVersion(op2, version)
	if err != nil {
		t.Errorf("Simple Operation failed (Error %q)", err)
	}
	err = doc.ApplyToVersion(op1, version)
	if err != nil {
		t.Errorf("Concurrent Left Operation failed (Error %q)", err)
	}
	dict, _ := doc.Snapshot()
	result, _ := dict.get([]string{"doc"})
	if result != target {
		t.Errorf("Concurrent Left Operation failed %q != %q", result, target)
	}
}

func TestDocumentSnapshotConcurrentRight(t *testing.T) {
	doc := newTestDocument()
	target := "Hahaho this is some text"
	version := doc.Version()
	op1 := Operation{Component{
		Path: []string{"doc", "4"},
		Si:   "ho",
	}}
	// Expecting Hahaho this is is some text
	op2 := Operation{Component{
		Path: []string{"doc", "7"},
		Sd:   "is ",
	}}
	// Expecting Haha this is some text
	// Combination of both should end up in Hahaho this is some text

	//LEFT OP
	err := doc.ApplyToVersion(op1, version)
	if err != nil {
		t.Errorf("Simple Operation failed (Error %q)", err)
	}
	err = doc.ApplyToVersion(op2, version)
	if err != nil {
		t.Errorf("Concurrent Right Operation failed (Error %q)", err)
	}
	dict, _ := doc.Snapshot()
	result, _ := dict.get([]string{"doc"})
	if result != target {
		t.Errorf("Concurrent Right Operation failed %q != %q", result, target)
	}

}

func TestDocumentSnapshotInvalidDeletes(t *testing.T) {
	doc := NewDocument(
		Dict{
			"doc": "Haha this is is some text",
		},
	)
	op := Operation{Component{
		Path: []string{"doc", "0"},
		Sd:   "is ",
	}}
	doc.ApplyToVersion(op, doc.Version())
	_, err := doc.Snapshot()
	if _, ok := err.(InvalidComponentError); !ok {
		t.Error("Invalid DELETE did not raise error")
	}
}

func BenchmarkDocumentApplyToVersionWithInserts(b *testing.B) {
	doc := newTestDocument()
	op := Operation{Component{
		Path: []string{"doc", "0"},
		Si:   "ha ",
	}}
	for i := 0; i < b.N; i++ {
		doc.ApplyToVersion(op, doc.Version())
	}
}

func BenchmarkDocumentApplyToVersionWithDeletes(b *testing.B) {
	doc := NewDocument(
		Dict{
			"doc": "",
		},
	)
	op := Operation{Component{
		Path: []string{"doc", "0"},
		Sd:   "H",
	}}
	for i := 0; i < b.N; i++ {
		doc.ApplyToVersion(op, doc.Version())
	}
}
